import React from "react";
import "../assets/css/App.css";

const MainHome = () => (
  <div className="container">
    <center><h1 className="bgf">Welcome to Jarvis.</h1></center>
    <h3>This is application is a workflow application built for engineers by engineers</h3>
    <p>This application has a note taking application, and future iterations of this application will have a tasking board as well as a git repositiory to load projects</p>
  </div>
);

export default MainHome;
